import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './app';
import { Link } from 'react-router-dom';

function Index() {
  // Resto do código...

  return (
    <div>
      {/* Resto do código... */}

      <Link to="/busca">Ir para a página de busca</Link>
    </div>
  );
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
